      if (entity.grabbed){
        this.app.physicsWorld.contactsWith(entity.physics.collider, (collider2) => {
          let cursor = COLLIDER_CURSOR_MAP[collider2.handle]

          if (cursor) {
            entity.onGrab(collider2.translation())
          }
        })
      }
